/*!50003 CREATE*/ /*!50017 DEFINER=`psms`@`localhost`*/ /*!50003 TRIGGER `student_mark_after_update` AFTER UPDATE ON `student_mark` FOR EACH ROW mark_update:
BEGIN

    DECLARE currentClass, lang, currentGroup VARCHAR(255);
    DECLARE subjectOver, groupTotal, groupOver, groupAvg, langTotal, langOver, langAvg, globalAvg DECIMAL(5, 2);

    #     IF (ISNULL(New.mark) AND ISNULL(OLD.mark) OR (NEW.mark = OLD.mark)) THEN
#         LEAVE mark_update;
#     END IF;

    /** Getting this entry language and subject group */
    SELECT cs.classroom,
           cs.language,
           cs.subject_group,
           cs.marked_over
    INTO currentClass, lang, currentGroup, subjectOver
    FROM classroom_subject cs
    WHERE cs.id = NEW.classroom_subject;

    /** Getting the total and marked over for the current group and language */
    SELECT SUM(mark), SUM(marked_over), SUM(mark) * 20 / SUM(marked_over)
    INTO groupTotal, groupOver, groupAvg
    FROM student_mark sm
             JOIN classroom_subject cs ON cs.id = sm.classroom_subject
    WHERE (period, `language`, student, subject_group) = (NEW.period, lang, NEW.student, currentGroup)
      AND sm.mark IS NOT NULL;


    /** Getting the total and marked over for the current student in the current language */
    SELECT SUM(mark), SUM(marked_over), SUM(mark) * 20 / SUM(marked_over)
    INTO langTotal, langOver, langAvg
    FROM student_mark sm JOIN classroom_subject cs ON cs.id = sm.classroom_subject
    WHERE (period, language, student) = (NEW.period, lang, NEW.student)
      AND sm.mark IS NOT NULL;

    /** Computing the current student's global average */
    SELECT average2(langAvg, SUM(mark) * 20 / SUM(marked_over))
    INTO globalAvg
    FROM student_mark sm JOIN classroom_subject cs ON cs.id = sm.classroom_subject
    WHERE (period, student) = (NEW.period, NEW.student)
      AND `language` <> lang
      AND sm.mark IS NOT NULL;

    /** Updating student mark  by subject */
    UPDATE student_result_by_subject
    SET update_buffer = CONCAT_WS('|', NEW.period, lang, subjectOver, IFNULL(NEW.mark, '*'))
    WHERE (student, classroom_subject) = (NEW.student, new.classroom_subject);

    /** Updating student average  by group */
    UPDATE student_result_by_group
    SET update_buffer = CONCAT_WS('|', NEW.period, lang, IFNULL(groupTotal, '*'), IFNULL(groupOver, '*'))
    WHERE (student, `language`, subject_group) = (NEW.student, lang, currentGroup);

    /** Updating student average by language */
    UPDATE student_result_by_language
    SET update_buffer = CONCAT_WS('|', NEW.period, lang, IFNULL(langTotal, '*'), IFNULL(langOver, '*'))
    WHERE (student, `language`) = (NEW.student, lang);

    /** Updating student global average  */
    UPDATE student_result
    SET update_buffer = CONCAT_WS('|', NEW.period, IFNULL(globalAvg, '*'))
    WHERE student = NEW.student;

    /** Updating student ranking for the current classroom subject */
    WITH tmp AS (SELECT id,
                        IF(eval1average IS NULL, NULL, RANK() OVER (ORDER BY eval1average DESC )) AS e1,
                        IF(eval2average IS NULL, NULL, RANK() OVER (ORDER BY eval2average DESC )) AS e2,
                        IF(term1average IS NULL, NULL, RANK() OVER (ORDER BY term1average DESC )) AS t1,
                        IF(eval3average IS NULL, NULL, RANK() OVER (ORDER BY eval3average DESC )) AS e3,
                        IF(eval4average IS NULL, NULL, RANK() OVER (ORDER BY eval4average DESC )) AS e4,
                        IF(term2average IS NULL, NULL, RANK() OVER (ORDER BY term2average DESC )) AS t2,
                        IF(eval5average IS NULL, NULL, RANK() OVER (ORDER BY eval5average DESC )) AS e5,
                        IF(eval6average IS NULL, NULL, RANK() OVER (ORDER BY eval6average DESC )) AS e6,
                        IF(term3average IS NULL, NULL, RANK() OVER (ORDER BY term3average DESC )) AS t3,
                        IF(year_average IS NULL, NULL, RANK() OVER (ORDER BY year_average DESC )) AS yr
                 FROM student_result_by_subject
                 WHERE classroom_subject = NEW.classroom_subject)
    UPDATE tmp LEFT JOIN student_result_by_subject s USING (id)
    SET eval1rank = e1,
        eval2rank = e2,
        term1rank = t1,
        eval3rank = e3,
        eval4rank = e4,
        term2rank = t2,
        eval5rank = e5,
        eval6rank = e6,
        term3rank = t3,
        year_rank = yr
    WHERE TRUE;

    /** Updating student ranking for the current group in the current student's classroom */
    WITH tmp AS (SELECT s.id,
                        IF(eval1average IS NULL, NULL, RANK() OVER (ORDER BY eval1average DESC )) AS e1,
                        IF(eval2average IS NULL, NULL, RANK() OVER (ORDER BY eval2average DESC )) AS e2,
                        IF(term1average IS NULL, NULL, RANK() OVER (ORDER BY term1average DESC )) AS t1,
                        IF(eval3average IS NULL, NULL, RANK() OVER (ORDER BY eval3average DESC )) AS e3,
                        IF(eval4average IS NULL, NULL, RANK() OVER (ORDER BY eval4average DESC )) AS e4,
                        IF(term2average IS NULL, NULL, RANK() OVER (ORDER BY term2average DESC )) AS t2,
                        IF(eval5average IS NULL, NULL, RANK() OVER (ORDER BY eval5average DESC )) AS e5,
                        IF(eval6average IS NULL, NULL, RANK() OVER (ORDER BY eval6average DESC )) AS e6,
                        IF(term3average IS NULL, NULL, RANK() OVER (ORDER BY term3average DESC )) AS t3,
                        IF(year_average IS NULL, NULL, RANK() OVER (ORDER BY year_average DESC )) AS yr
                 FROM student_result_by_group s JOIN student s2 ON s2.id = s.student
                 WHERE (s2.classroom, s.language, s.subject_group) = (currentClass, lang, currentGroup))
    UPDATE tmp LEFT JOIN student_result_by_group s USING (id)
    SET eval1rank = e1,
        eval2rank = e2,
        term1rank = t1,
        eval3rank = e3,
        eval4rank = e4,
        term2rank = t2,
        eval5rank = e5,
        eval6rank = e6,
        term3rank = t3,
        year_rank = yr
    WHERE TRUE;

    /** Updating student ranking for the current language in the current student's classroom */
    WITH tmp AS (SELECT s.id,
                        IF(eval1average IS NULL, NULL, RANK() OVER (ORDER BY eval1average DESC )) AS e1,
                        IF(eval2average IS NULL, NULL, RANK() OVER (ORDER BY eval2average DESC )) AS e2,
                        IF(term1average IS NULL, NULL, RANK() OVER (ORDER BY term1average DESC )) AS t1,
                        IF(eval3average IS NULL, NULL, RANK() OVER (ORDER BY eval3average DESC )) AS e3,
                        IF(eval4average IS NULL, NULL, RANK() OVER (ORDER BY eval4average DESC )) AS e4,
                        IF(term2average IS NULL, NULL, RANK() OVER (ORDER BY term2average DESC )) AS t2,
                        IF(eval5average IS NULL, NULL, RANK() OVER (ORDER BY eval5average DESC )) AS e5,
                        IF(eval6average IS NULL, NULL, RANK() OVER (ORDER BY eval6average DESC )) AS e6,
                        IF(term3average IS NULL, NULL, RANK() OVER (ORDER BY term3average DESC )) AS t3,
                        IF(year_average IS NULL, NULL, RANK() OVER (ORDER BY year_average DESC )) AS yr
                 FROM student_result_by_language s JOIN student s2 ON s2.id = s.student
                 WHERE (s2.classroom, s.language) = (currentClass, lang))
    UPDATE tmp LEFT JOIN student_result_by_language s USING (id)
    SET eval1rank = e1,
        eval2rank = e2,
        term1rank = t1,
        eval3rank = e3,
        eval4rank = e4,
        term2rank = t2,
        eval5rank = e5,
        eval6rank = e6,
        term3rank = t3,
        year_rank = yr
    WHERE TRUE;

    /** Updating student ranking for the current language in the current student's classroom */
    WITH tmp AS (SELECT s.id,
                        IF(eval1average IS NULL, NULL, RANK() OVER (ORDER BY eval1average DESC )) AS e1,
                        IF(eval2average IS NULL, NULL, RANK() OVER (ORDER BY eval2average DESC )) AS e2,
                        IF(term1average IS NULL, NULL, RANK() OVER (ORDER BY term1average DESC )) AS t1,
                        IF(eval3average IS NULL, NULL, RANK() OVER (ORDER BY eval3average DESC )) AS e3,
                        IF(eval4average IS NULL, NULL, RANK() OVER (ORDER BY eval4average DESC )) AS e4,
                        IF(term2average IS NULL, NULL, RANK() OVER (ORDER BY term2average DESC )) AS t2,
                        IF(eval5average IS NULL, NULL, RANK() OVER (ORDER BY eval5average DESC )) AS e5,
                        IF(eval6average IS NULL, NULL, RANK() OVER (ORDER BY eval6average DESC )) AS e6,
                        IF(term3average IS NULL, NULL, RANK() OVER (ORDER BY term3average DESC )) AS t3,
                        IF(year_average IS NULL, NULL, RANK() OVER (ORDER BY year_average DESC )) AS yr
                 FROM student_result s JOIN student s2 ON s2.id = s.student
                 WHERE s2.classroom = currentClass)
    UPDATE tmp LEFT JOIN student_result s USING (id)
    SET eval1rank = e1,
        eval2rank = e2,
        term1rank = t1,
        eval3rank = e3,
        eval4rank = e4,
        term2rank = t2,
        eval5rank = e5,
        eval6rank = e6,
        term3rank = t3,
        year_rank = yr
    WHERE TRUE;

END */;;
